export const Our_Journey = (props) => {
    return (
      <div id='our_journey' className='text-center'>
        <div className='container'>
            <div className='journey-title'>
        <h2>Our Journey</h2> 
        </div>
        <div className='journey-image'>
              <img src="./img/journey.png" className="img-background" alt="" />{" "} 
              <img src="./img/frontjourney.png" className="img-front" alt="" />{" "}
        </div>
        </div>
    </div>
     )
    }
